webpackJsonp([77108343091530],{379:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Our next round of thanks goes to our Gold Sponsors. All of them have strong\npresences in Singapore and many of them have been supporting the local Python\ncommunity and past Python conferences for years.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://jetbrains.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 222px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 108.1081081081081%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor jetbrains" title="" src="/static/sponsor-jetbrains-3da02dd52f8ad5057026b884e32a2a2b-80243.png" srcset="/static/sponsor-jetbrains-3da02dd52f8ad5057026b884e32a2a2b-6d871.png 208w,\n/static/sponsor-jetbrains-3da02dd52f8ad5057026b884e32a2a2b-80243.png 222w" sizes="(max-width: 222px) 100vw, 222px">\n    </span>\n  </span>\n  </a></div>\n<p>JetBrains has stepped up as the official sponsor for the Coding Competition\nwhich will be held at the end of Day 1 (March 31). Stay tuned for a fun event\nand some cool prices!!</p>\n<p>Dmitry Trofimov and Ernst Haagsman, PyCharm team lead and product marketing\nmanager, will be manning the booth. Drop by and ask them about the newest\nfeatures, and to tell them how you’ve been using PyCharm. If there’s a feature\nthey could make that would make your life easier, now is the time to come over\nand let them know.</p>\n<p>JetBrains delivers intelligent software solutions that make developers\nmore productive by simplifying their challenging tasks, automating the\nroutine, and helping them adopt the best development practices.\nPyCharm is the Python IDE for Professional Developers by JetBrains\nproviding a complete set of tools for productive Python, Web and\nscientific development, available in three editions. The free and\nopen-source PyCharm Community Edition is perfect for pure Python\ncoding. PyCharm Professional Edition is designed for professional\nPython and Web developers. PyCharm Educational Edition helps novice\nprogrammers learn programming with Python easily and effectively.</p>\n<hr />\n<div style="margin-top: 2em; margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://zendesk.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 832px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 72.76933245208195%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor zendesk" title="" src="/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-81865.png" srcset="/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-6b57d.png 208w,\n/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-0949b.png 416w,\n/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-81865.png 832w,\n/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-848de.png 1248w,\n/static/sponsor-zendesk-2f6f847c0b4abd694599d070c6a3f61a-e65f6.png 1513w" sizes="(max-width: 832px) 100vw, 832px">\n    </span>\n  </span>\n  </a></div>\n<p>Zendesk\'s unique approach to customer engagement enables companies to\nlisten, respond, and delight both their customers and agents in ways\nnot possible before. Loved for its simplicity and elegance, Zendesk is\nthe easiest and fastest way to provide great customer service, and\nhelp brands be the company their customers want them to be.</p>\n<p>Zendesk currently delivers its leading cloud-based customer engagement\nsoftware to more than 119,000 brands around the world. It is easy to\ntry, buy, implement, and use, so both companies, their agents and\ncustomers will start seeing positive results immediately. Put simply,\nthe best customer experiences are built with Zendesk.</p>\n<hr />\n<div style="margin-top: 2em; margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://thoughtworks.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 15.416666666666664%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor thoughtworks" title="" src="/static/sponsor-thoughtworks-a0069c41885f62ff762b952c9cab2611-64e74.png" srcset="/static/sponsor-thoughtworks-a0069c41885f62ff762b952c9cab2611-53de2.png 208w,\n/static/sponsor-thoughtworks-a0069c41885f62ff762b952c9cab2611-5dd2f.png 416w,\n/static/sponsor-thoughtworks-a0069c41885f62ff762b952c9cab2611-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>ThoughtWorks is a global technology consultancy, 5000 people strong\nacross 43 offices in 14 countries. They are a collection of passionate\npeople who care about technology. At their heart, they are a custom\nsoftware company and a community of designers, strategists and\nindustry experts who solve complex problems working with courageous\nexecutives who have ambitious missions.</p>\n<p>They think disruptively to address their clients’ toughest challenges\nthrough empowering technologies to help them succeed, all the while\nseeking to revolutionize the IT industry and create positive social\nchange. Their services span software delivery, products, and consulting,\nbut they prefer to talk about ideas, opportunities, and how we they help.\nDrop by their booth at the conference and join them!</p>\n<hr />\n<div style="margin-top: 2em; margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://100offer.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 19.375%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor 100offer" title="" src="/static/sponsor-100offer-89516dcac985cec9f4d2b3c391f0dbeb-64e74.png" srcset="/static/sponsor-100offer-89516dcac985cec9f4d2b3c391f0dbeb-53de2.png 208w,\n/static/sponsor-100offer-89516dcac985cec9f4d2b3c391f0dbeb-5dd2f.png 416w,\n/static/sponsor-100offer-89516dcac985cec9f4d2b3c391f0dbeb-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>100offer is the easiest way to find data science and developer roles\nat top tech companies. They are a marketplace community that gathers\nstar tech talent so that top enterprises can find them and invite them\nfor interviews. Candidates get end-to-end support with their talent\nconsultant, who helps free of charge.</p>\n<hr />\n<p>All four of our Gold Sponsors will have a booth at the conference, so\ndon\'t miss your chance to get to know them in person when you attend the\nconference!</p>',frontmatter:{date:"May 24, 2018",path:"/news/gold-sponsors",title:"Gold Sponsors for PyCon APAC 2018"}}},pathContext:{}}}});
